import React from 'react'
import './Pages.css';
import vid1 from '../public/vid1.mp4'

function Home() {
  return (
    <div className='home'>
      <video src={vid1} width="600" height="300" controls="controls" autoplay="true" />
    </div>
  )
}

export default Home
